import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './styles.css';

// Configure axios defaults
axios.defaults.baseURL = 'http://localhost:8000';  // Update this to match your Django server port
axios.defaults.withCredentials = true;

function getCookie(name) {
    let cookieValue = null;
    if (document.cookie && document.cookie !== '') {
        const cookies = document.cookie.split(';');
        for (let i = 0; i < cookies.length; i++) {
            const cookie = cookies[i].trim();
            if (cookie.startsWith(name + '=')) {
                cookieValue = decodeURIComponent(cookie.substring(name.length + 1));
                break;
            }
        }
    }
    return cookieValue;
}

const ExpenseForm = ({ titleId, isAdmin, onClose }) => {
  const [formData, setFormData] = useState({
    expense_title: titleId,
    master_group: '',
    subgroup: '',
    amount: '',
    currency: 'USD',
    date: '',
    status: 'pending',
    comments: '',
    attachment: null
  });

  const [subgroups, setSubgroups] = useState([]);
  const [error, setError] = useState('');
  const [isSubmitting, setIsSubmitting] = useState(false);
  const [uploadRetryCount, setUploadRetryCount] = useState(0);
  const MAX_RETRIES = 3;

  const masterGroups = {
    TRAVEL: ['TICKET', 'FOOD', 'HOSPITALITY'],
    OFFICE_SUPPLIES: ['EQUIPMENT', 'STATIONERY'],
    UTILITIES: ['INTERNET', 'ELECTRICITY']
  };

  const currencies = ['USD', 'EUR', 'GBP', 'INR'];

  useEffect(() => {
    if (formData.master_group) {
      setSubgroups(masterGroups[formData.master_group]);
    }
  }, [formData.master_group]);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleFileChange = (e) => {
    const file = e.target.files[0];
    if (file) {
      setFormData(prev => ({
        ...prev,
        attachment: file
      }));
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setIsSubmitting(true);

    try {
      const csrftoken = getCookie('csrftoken');
      const token = localStorage.getItem('token');

      if (!token) {
        throw new Error('Authentication token not found');
      }

      const formDataToSend = new FormData();
      Object.keys(formData).forEach(key => {
        if (formData[key] !== null) {
          formDataToSend.append(key, formData[key]);
        }
      });

      const response = await axios.post('/api/expense-forms/', formDataToSend, {
        headers: {
          'X-CSRFToken': csrftoken,
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'multipart/form-data'
        },
        withCredentials: true
      });

      if (response.data) {
        console.log('Form submitted successfully:', response.data);
        onClose();
      } else {
        setError('Failed to create expense form. Server returned no data.');
      }
    } catch (error) {
      console.error('Error submitting form:', error);

      // Handle OneDrive token expiration
      if (error.response?.data?.detail?.includes('OneDrive') || 
          error.response?.data?.detail?.includes('InvalidAuthenticationToken')) {

        if (uploadRetryCount < MAX_RETRIES) {
          setUploadRetryCount(prev => prev + 1);
          setError('OneDrive connection issue. Retrying...');

          // Wait for 2 seconds before retrying
          setTimeout(() => {
            handleSubmit(e);
          }, 2000);
        } else {
          setError('Failed to upload attachment after multiple attempts. Please try again later or contact support.');
        }
      } else if (error.response?.status === 401) {
        setError('Session expired. Please log in again.');
      } else {
        setError(error.response?.data?.detail || 'Failed to submit form. Please try again.');
      }
    } finally {
      setIsSubmitting(false);
    }
  };

  return (
    <div className="card">
      <form onSubmit={handleSubmit}>
        {error && <div className="error-message">{error}</div>}

        <div className="form-row">
          <div className="form-group">
            <label>Master Group</label>
            <select
              name="master_group"
              value={formData.master_group}
              onChange={handleInputChange}
              required
            >
              <option value="">Select Master Group</option>
              {Object.keys(masterGroups).map(group => (
                <option key={group} value={group}>{group.replace('_', ' ')}</option>
              ))}
            </select>
          </div>

          <div className="form-group">
            <label>Subgroup</label>
            <select
              name="subgroup"
              value={formData.subgroup}
              onChange={handleInputChange}
              required
              disabled={!formData.master_group}
            >
              <option value="">Select Subgroup</option>
              {subgroups.map(subgroup => (
                <option key={subgroup} value={subgroup}>{subgroup.replace('_', ' ')}</option>
              ))}
            </select>
          </div>
        </div>

        <div className="form-row">
          <div className="form-group">
            <label>Amount</label>
            <input
              type="number"
              name="amount"
              value={formData.amount}
              onChange={handleInputChange}
              required
            />
          </div>

          <div className="form-group">
            <label>Currency</label>
            <select
              name="currency"
              value={formData.currency}
              onChange={handleInputChange}
              required
            >
              {currencies.map(currency => (
                <option key={currency} value={currency}>{currency}</option>
              ))}
            </select>
          </div>
        </div>

        <div className="form-row">
          <div className="form-group">
            <label>Date</label>
            <input
              type="date"
              name="date"
              value={formData.date}
              onChange={handleInputChange}
              required
            />
          </div>

          {isAdmin && (
            <div className="form-group">
              <label>Status</label>
              <select
                name="status"
                value={formData.status}
                onChange={handleInputChange}
              >
                <option value="pending">Pending</option>
                <option value="approved">Approved</option>
                <option value="rejected">Rejected</option>
              </select>
            </div>
          )}
        </div>

        {isAdmin && (
          <div className="form-group">
            <label>Comments</label>
            <textarea
              name="comments"
              value={formData.comments}
              onChange={handleInputChange}
              placeholder="Enter comments..."
            />
          </div>
        )}

        <div className="form-group">
          <label>Attachment</label>
          <input
            type="file"
            name="attachment"
            onChange={handleFileChange}
            accept=".pdf,.doc,.docx,.jpg,.jpeg,.png"
          />
        </div>

        <div className="form-group">
          <button
            type="submit"
            className="btn"
            disabled={isSubmitting}
          >
            {isSubmitting ? 'Submitting...' : 'Submit'}
          </button>
          <button 
            type="button" 
            onClick={onClose} 
            className="btn btn-secondary"
            disabled={isSubmitting}
          >
            Cancel
          </button>
        </div>
      </form>
    </div>
  );
};

export default ExpenseForm;
